import React from 'react';
import './App.css';
import TextField from '@material-ui/core/TextField';
import { makeStyles } from "@material-ui/core/styles";


function App() {
  return (
    <div className="App">
        <p>Ad-lib</p>
        <form noValidate autoComplete="off">
          <TextField id="standard-basic" label="Insert Text" />
          <br></br>
          <br></br>
          <TextField id="time" label="Select a time" type="time" defaultValue="07:30"/>
        </form>
    </div>
  );
}

export default App;
